import math

# Define the function F_n
def F_n(x, n):
    if n == 0:
        return math.log(x)
    else:
        return (1 / math.factorial(n)) * math.log(x)

# Calculate the limit
limit = 1
for n in range(1, 100):
    F_n_value = F_n(1, n)
    limit += (n * F_n_value) / math.log(n)

print(round(limit, 3))
